import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    IconButton,
    Box,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Container,
  } from "@mui/material";
  import Button from '@mui/material/Button';
import { BusAlertTwoTone } from '@mui/icons-material';

  function HomePage() {
    return (
      <Container
        fixed
        sx={{
          bgcolor: "transparent",
          marginTop: '10vh', 
          marginBottom: '10vh',
          width: "100%",
          height: "100vh",
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'space-between',
        }}
      >
        <Box sx={{ flex: 1, textAlign: 'center' }}> 
          <Box name="center-left">
            <h1 style={{margin: "0", padding: "10px"}}> Hi,</h1>
            <h1 style={{margin: "0", padding: "10px"}}>I'm Nemanja</h1>
            <Button variant="contained">About Me </Button>
          </Box>
        </Box>
        <Box sx={{ flex: 1, textAlign: 'center' }}> 
          <h1>Right</h1>
        </Box>
      </Container>
    );
  }

  export default HomePage;
